import React, {useState} from 'react';
import {
  SafeAreaView,
  ScrollView,
  Text,
  View,
  Alert,
  StyleSheet,
  Button,
} from 'react-native';

import {enhetApi} from './api';


type MyProps = {
  // using `interface` is also ok
  message: string;
};
type MyState = {
  grunnskole: {},
  vgs: {},
};
class Data extends React.Component<MyProps, MyState> {

  state: MyState = {
    // optional second annotation for better type inference
    grunnskole: {},
    vgs: {},
  };

  componentDidMount = async () => {
    try {
      const fetchedgrunnskole = await enhetApi.getEnheterWithSkolekategori('1');
      this.setState({grunnskole: fetchedgrunnskole.data});
    } catch (error) {
      console.warn(error)
      Alert.alert('An error occurred');
    }

    try {
      const fetchedvgs = await enhetApi.getEnheterWithSkolekategori('2');
      this.setState({vgs: fetchedvgs.data});
    } catch (error) {
      console.warn(error)
      Alert.alert('An error occurred');
    }
  }


  render() {
    return (
      <div>
        {this.props.message} {this.state.count}
      </div>
    );
  }
}




const App = () => {
  const [grunnskole, setGrunnskole] = useState({});
  const [vgs, setVGS] = useState({});


  const getGrunnskole = async () => {
    try {
      const fetchedgrunnskole = await enhetApi.getEnheterWithSkolekategori('1');
      setGrunnskole(fetchedgrunnskole.data);
    } catch (error) {
      console.warn(error)
      Alert.alert('An error occurred');
    }
  };

  const getVGS = async () => {
    try {
      const fetchedvgs = await enhetApi.getEnheterWithSkolekategori('2');
      setVGS(fetchedvgs.data);
    } catch (error) {
      console.warn(error)
      Alert.alert('An error occurred');
    }
  };

  return (
    <SafeAreaView>
      <ScrollView>
        <View>
          <Button title="Get Grunnskole" onPress={() => getGrunnskole()} />
          <Button title="Get VGS" onPress={() => getVGS()} />
          <Text style={styles.schools}>{JSON.stringify(grunnskole)}</Text>
          <Text style={styles.schools}>{JSON.stringify(vgs)}</Text>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  button: {
    padding: 20,
    margin: 20,
    borderWidth: 4,
    borderColor: '#000',
    borderRadius: 10,
  },
  buttonText: {
    fontSize: 24,
    fontWeight: '900',
  },
  schools: {
    fontSize: 18,
    padding: 30,
    marginTop: 40,
  },
});

export default App;
